function calcRecommendations(gender) {
  var waterType = 0,
      calType = 0;

  if (gender === 'men') {
    waterType = 35;
    calType = -5;
  } else {
    waterType = 31;
    calType = 161;
  } // BMI


  if (localStorage[lsWeightType] === kg_C.name) {
    var BMI = (+localStorage[lsKg_C] / Math.pow(+localStorage[lsTall] / 100, 2)).toFixed(2);
  } else {
    var BMI = (+localStorage[lsLbs_C] / Math.pow(localStorage.vean_tall / 100 * 39.37, 2) * 703).toFixed(2);
  }

  var leftW = BMI / 60 * 100,
      dataBim = BMI;

  if (leftW >= 95) {
    leftW = 95;
    dataBim = '60 <';
  }

  recommendation__BMI_input.style.cssText = "left: ".concat(leftW, "%");
  recommendation__BMI_input.dataset.bmi = dataBim;

  if (BMI < 18.50) {
    healthyEl.textContent = underweight;
  } else if (BMI >= 18.50 && BMI < 24.9) {
    healthyEl.textContent = healthy;
  } else if (BMI >= 25 && BMI < 29.9) {
    healthyEl.textContent = overweight;
  } else {
    healthyEl.textContent = obese;
  } // Water


  var normalConsumption = (+localStorage[lsKg_C] * waterType / 1000).toFixed(1);
  water.textContent += normalConsumption;
  normalConsumption /= 0.5;
  normalConsumption < 10 ? normalConsumption : normalConsumption = 10;

  for (var i = 0; i < Math.round(normalConsumption); i++) {
    var recommendation__glas = recommendation__glasses[i];
    recommendation__glas.classList.add('_filled');
  } // Cal


  var recommendedCal = (10 * localStorage[lsKg_C] + 6.25 * localStorage[lsTall] - 5 * localStorage[lsAge] - calType).toFixed(0);
  cal.textContent = recommendedCal + cal.textContent;
  var leftC = recommendedCal / 5000 * 100;

  if (leftC >= 95) {
    leftC = 95;
  }

  recommendation__calories_input.style.cssText = "left: ".concat(leftC, "%");
  recommendation__calories_input.dataset.calories = "".concat((recommendedCal * 0.9).toFixed(0), " - ").concat((recommendedCal * 1.1).toFixed(0));
}

